import {connect} from 'react-redux';
import {bindActionCreators} from 'redux';
import * as appActions from '../actions/appActions';
import {Link} from 'react-router-dom'
import React from 'react';

class appList extends React.Component {
  constructor(props) {
        super(props)
    }

    componentWillMount() {
        this.props.appActions.fetchApplications();
    }

    renderData(item) {
        return   <Link to={`/details/${item.id.attributes["im:id"]}`} >
          <div class="col-md-4" key={item.id.attributes["im:id"]}>{item.title["label"]}</div>
          </Link>;
    }

    render() {
      var reportData = this.props.apps;
      console.log(reportData.apps);
        if(!reportData){
            return (
                <div>
                    Loading Stuff...
                </div>
            )
        }else{
            return (
                <div className="row">
                {reportData.map(function(item){
                      return (
                        <div class="col-me-4">
                          <Link to={`/details/${item.id.attributes["im:id"]}`} >
                            <h4 key={item.id.attributes["im:id"]}>{item.title["label"]}</h4>
                          </Link>
                        </div>
                      );
                    })}
                </div>
            )
        }
    }
}


function mapStateToProps(state) {
    return {
        apps: state.apps
    };
}

function mapDispatchToProps(dispatch) {
    return {
       appActions: bindActionCreators(appActions, dispatch)
    };
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(appList);
